import React, { useEffect, useState } from "react";

function App() {
    const [status, setstatus] = useState();
    const Submit = (det) => {
        fetch("http://192.168.43.117:5000/values"
        , {
          method: "POST",
          headers: {
            Accept: "application/json",
            "Content-Type": "application/json",
          },
          body: JSON.stringify({
            details: det,
          }),
        })
          .then((res) => res.json())
          .then(values => {
            console.log(values);
          })
      };

      return (
        <div>
            <form onSubmit={Submit}>
                    <a>Enter the name:</a>
                    <input type="text" name={status} onChange={(status) => setstatus(status)}></input>
                    <button onClick={() => Submit("giri")}>Submit</button>
            </form>
        </div>

      );
    }

export default App;
